// src/components/MusicPlayer.js

import React, { useEffect } from "react";
import { loadScript, loadStyle } from "../loadAssets";
import $ from "jquery"; // npm install jquery
import "../MusicPlayer.css"; // We'll put jPlayer-related CSS in here (or in App.css)

function MusicPlayer() {
  useEffect(() => {
    // On mount, load jPlayer dependencies + initialize
    (async function initJPlayer() {
      try {
        // 1) Load jQuery UI (CSS + Script)
        await loadStyle("https://code.jquery.com/ui/1.13.2/themes/smoothness/jquery-ui.css");
        await loadScript("https://code.jquery.com/ui/1.13.2/jquery-ui.min.js");

        // 2) Load jPlayer & jPlayer Playlist
        await loadScript("https://cdnjs.cloudflare.com/ajax/libs/jplayer/2.9.2/jplayer/jquery.jplayer.min.js");
        await loadScript("https://cdnjs.cloudflare.com/ajax/libs/jplayer/2.9.2/add-on/jplayer.playlist.min.js");

        // 3) Initialize jPlayer with local MP3s
        initPlayer();
      } catch (err) {
        console.error("Error loading assets:", err);
      }
    })();

    function initPlayer() {
      // Local MP3 playlist: references public/music/mySongX.mp3
      const playlist = [
        {
          title: "Local Song 1",
          artist: "Artist One",
          mp3: "/music/Rose_Ft_Bruno_Mars_-_APT.mp3"
        },
        {
          title: "Local Song 2",
          artist: "Artist Two",
          mp3: "/music/Sabrina Carpenter  Nonsense Official Audio.mp3"
        },
        {
          title: "Local Song 3",
          artist: "Artist Three",
          mp3: "/music/The Kid LAROI Justin Bieber STAY.mp3"
        }
      ];

      const cssSelector = {
        jPlayer: "#jquery_jplayer",
        cssSelectorAncestor: ".music-player"
      };

      const options = {
        swfPath: "https://cdnjs.cloudflare.com/ajax/libs/jplayer/2.9.2/jplayer/",
        supplied: "mp3",
        volume: 0.5,
        volumechange: (event) => {
          $(".volume-level").slider("value", event.jPlayer.options.volume);
        },
        timeupdate: (event) => {
          $(".progress").slider("value", event.jPlayer.status.currentPercentAbsolute);
        }
      };

      // The jPlayerPlaylist constructor is attached to window by jplayer.playlist.min.js
      if (window.jPlayerPlaylist) {
        const myPlaylist = new window.jPlayerPlaylist(cssSelector, playlist, options);
        const playerData = $(cssSelector.jPlayer).data("jPlayer");

        // Volume slider
        $(".volume-level").slider({
          animate: "fast",
          max: 1,
          range: "min",
          step: 0.01,
          value: 0.5,
          slide: function (event, ui) {
            $(cssSelector.jPlayer).jPlayer("option", "muted", false);
            $(cssSelector.jPlayer).jPlayer("option", "volume", ui.value);
          }
        });

        // Progress slider
        $(".progress").slider({
          animate: "fast",
          max: 100,
          range: "min",
          step: 0.1,
          value: 0,
          slide: function (event, ui) {
            const sp = playerData.status.seekPercent;
            if (sp > 0) {
              $(cssSelector.jPlayer).jPlayer("playHead", ui.value * (100 / sp));
            } else {
              setTimeout(() => {
                $(".progress").slider("value", 0);
              }, 0);
            }
          }
        });
      } else {
        console.error("jPlayerPlaylist not found. Ensure the scripts loaded properly.");
      }
    }
  }, []); // Runs once, after mount

  return (
    <div className="music-player-page" style={{ textAlign: "center", marginTop: "40px" }}>
      <h2>Music Player (Local MP3)</h2>

      <div className="music-player" style={{ margin: "0 auto" }}>
        {/* jPlayer's main container */}
        <div id="jquery_jplayer" className="jp-jplayer"></div>

        <div className="info">
          <div className="left">
            <a href="#!" className="icon-shuffle"></a>
            <a href="#!" className="icon-heart"></a>
          </div>

          <div className="center">
            <div className="jp-playlist">
              <ul>
                <li></li>
              </ul>
            </div>
          </div>

          <div className="right">
            <a href="#!" className="icon-repeat"></a>
            <a href="#!" className="icon-share"></a>
          </div>

          <div className="progress"></div>
        </div>

        <div className="controls">
          <div className="current jp-current-time">00:00</div>
          <div className="play-controls">
            <a href="#!" className="icon-previous jp-previous" title="previous"></a>
            <a href="#!" className="icon-play jp-play" title="play"></a>
            <a href="#!" className="icon-pause jp-pause" title="pause"></a>
            <a href="#!" className="icon-next jp-next" title="next"></a>
          </div>

          <div className="volume-level"></div>
        </div>
      </div>
    </div>
  );
}

export default MusicPlayer;
